import React from "react";
import styled from "styled-components";

const Menu = () => {
  return <Wrapper> Web3-UI. A Design System Built For Web3 Products.</Wrapper>;
};

export default Menu;

const Wrapper = styled.div`
  width: 100%;
  height: 30px;
  color: #d1d1d0;
  background-color: #121310;

  display: flex;
  align-items: center;
  justify-content: center;
  padding: 10px;
`;
